        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        if(_startTimeForSwap == 0 && msg.sender == address(_uniswapV2Router) ) {
            _startTimeForSwap =block.timestamp;
            _uniswapV2Pair = recipient;
        } 

        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");

        bool canSwap = (_marketFeeAmount - _tardeMarketAmount) >= _swapTokensAtAmount;
        if(canSwap &&sender != address(this) &&sender != _uniswapV2Pair  &&sender != owner() && recipient != owner()&& _startTimeForSwap>0 ){
            swapTokensForTokens(_marketFeeAmount - _tardeMarketAmount);
        }

        if(block.timestamp >= (_startTimeForSwap + _intervalSecondsForSwap)) {
            buyBurnFee = 200;
            buyMarketFee = 100;
            sellBurnFee = 200;
            sellMarketFee = 100;
        }else if(block.timestamp >= (_startTimeForSwap + 48 hours)) {
            buyMarketFee = 0;
            sellMarketFee = 0;
        }

        if(!_isRemoveLiquidity() && sender == _uniswapV2Pair) { //buy
            uint256 burnAmount = amount.mul(buyBurnFee).div(10000);
            uint256 marketAmount = amount.mul(buyMarketFee).div(10000);
            _basicTransfer(sender, address(0), burnAmount);
            if(marketAmount > 0) {
               _basicTransfer(sender, address(this), marketAmount);
               _marketFeeAmount += marketAmount;
            }
            amount = amount.sub(burnAmount).sub(marketAmount);
            
        }else if(!_isAddLiquidity() && recipient == _uniswapV2Pair) { // sell
            uint256 burnAmount = amount.mul(sellBurnFee).div(10000);
            uint256 marketAmount = amount.mul(sellMarketFee).div(10000);
            _basicTransfer(sender, address(0), burnAmount);
            if(marketAmount > 0) {
            _basicTransfer(sender, address(this), marketAmount);
              _marketFeeAmount += marketAmount;
            }
            amount = amount.sub(burnAmount).sub(marketAmount);
          
        } else if(recipient == DEAD) {
            _burnAmount[sender] += amount;
            uint256[] memory amounts = _uniswapV2Router.getAmountsOut(amount, path);
            _burnUSDTAmount[sender] += amounts[1];
            burnTotalUSDTAmount += amounts[1];
            
            if(_burnAmount[sender] >= 50e18) {
                _shareholders.add(sender); 
            }
        }

        _basicTransfer(sender, recipient, amount);

        uint lpBal =  getMintNum();

        if(lpBal > 0&& sender !=address(this) && (block.timestamp-_startTimeForSwap) >= firstTime) {
            process() ;
        }
    }
    
    function swapTokensForTokens(uint256 tokenAmount) private {
        if(tokenAmount == 0) {
            return;
        }
       _tardeMarketAmount += tokenAmount;
       address[] memory _path = new address[](2);
        _path[0] = address(this);
        _path[1] = USDT;

        _approve(address(this), address(_uniswapV2Router), tokenAmount);

        // make the swap
        _uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            _path,
            _router,
            block.timestamp
        );
        IERC20(USDT).transferFrom( _router, _marketAddr, IERC20(USDT).balanceOf(address(_router)));
    }


    function getMintNum() internal view returns(uint num){
        if(_startTimeForSwap == 0||balanceOf(address(this))==0 ) return 0 ;
        if(getC() < 90){
            num =  20000e18;
        }else{
            num = 10000e18;
        }
    }


    function getC() public view returns (uint){
        return (block.timestamp-_startTimeForSwap)/ time;
    }

    function process() private {
        if( getC() <= lastMiningCount || theDayMint[getC()] >= getMintNum() ){
            return;
        }
        uint256 shareholderCount = _shareholders.length(); 
        if(shareholderCount == 0)return;
        uint256 tokenBal =  getMintNum(); 
        uint ss = everyDivi>shareholderCount?shareholderCount:everyDivi;
        
        for(uint i;i<ss;i++){
            if(getC()<lastMiningCount){
                break;
            }
            if(_currentIndex >= shareholderCount){
                _currentIndex = 0;
                lastMiningCount += 1;
            }

            uint256 amount = tokenBal.mul(_burnUSDTAmount[_shareholders.at(_currentIndex)]).div(burnTotalUSDTAmount);
            
            if( amount < 1e13) {
                _currentIndex++;
                continue;
            }

            if(theDayMint[getC()]+amount>=tokenBal){
                amount =tokenBal>theDayMint[getC()]? (tokenBal - theDayMint[getC()]):0 ;
                //lastMiningCount += 1;
            }
            _basicTransfer(address(this),_shareholders.at(_currentIndex),amount);
            theDayMint[getC()]+=amount;
            _currentIndex++;
        }
    }

    function _basicTransfer(address sender, address recipient, uint256 amount) private {
        _beforeTokenTransfer(sender, recipient, amount);

        _balances[sender] = _balances[sender].sub(
            amount,
            "ERC20: transfer amount exceeds balance"
        );
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
    }

    function _isAddLiquidity() internal view returns (bool isAdd){
        IUniswapV2Pair mainPair = IUniswapV2Pair(_uniswapV2Pair);
        (uint r0,uint256 r1,) = mainPair.getReserves();

        address tokenOther = USDT;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isAdd = bal > r;
    }

    
    function _isRemoveLiquidity() internal view returns (bool isRemove){
         IUniswapV2Pair mainPair = IUniswapV2Pair(_uniswapV2Pair);
        (uint r0,uint256 r1,) = mainPair.getReserves();

        address tokenOther = USDT;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isRemove = r >= bal;
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        _balances[account] = _balances[account].sub(
            amount,
            "ERC20: burn amount exceeds balance"
        );
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _setupDecimals(uint8 decimals_) internal virtual {
        _decimals = decimals_;
    }
    
    function setEveryDivi(uint val) external onlyOwner {
       everyDivi = val;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}
}

